import React, { Component } from 'react';
import { Menu, Icon, Input } from 'semantic-ui-react';
import { Link } from '../routes';

class Header extends Component {

    render() {
      return (
          // <Menu >
          //     <Link route="/"><a className="item">Ethereum-Based Question Answer System</a></Link>
          //     <Icon name='ethereum' />
          //     <Menu.Menu position="right">
          //         <Link route="/userProfile"><a className="item">Profile</a></Link>
          //         <Link route="/new"><a className="item">Create New Question</a></Link>
          //     </Menu.Menu>
          // </Menu>
          <Menu color='red'>
            <Link route='/'>
              <Menu.Item link='true'
                name="home"
              />
            </Link>
            <Link route='/userProfile'>
              <Menu.Item link='true'
                name="profile"
              />
            </Link>
            <Link route='/new'>
              <Menu.Item link='true'
                name="create new question"
              />
            </Link>
            <Menu.Menu position="right">
              <Menu.Item>
                <Input icon="search" placeholder="Search..." />
              </Menu.Item>
            </Menu.Menu>
          </Menu>
      );  
    }
};

export default Header;
